import React from "react";
import Page1P3 from "../assets/projects/P3/home-screen-mobile-kiddo.png";
import Page2P3 from "../assets/projects/P3/account-screen-mobile-kiddo.png";
import Page3P3 from "../assets/projects/P3/enrollment-screen-mobile-kiddo.png";
import Page4P3 from "../assets/projects/P3/settings-screen-mobile-kiddo.png";
import "../Projects/MediaQueries.css";
const P3 = () => {
    return (
    <div className="project_container">
        <div className="img1">
        <img src={Page1P3} alt="Page P1"/>
        </div>
        <div className="img2">
        <img src={Page2P3} alt="Page P2"/>
        </div>
        <div className="img3">
        <img src={Page3P3} alt="Page P3"/>
        </div>
        <div className="img4">
        <img src={Page4P3} alt="Page P4"/>
        </div>
    </div>
    )
}

export default P3;
